?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта компания была основана в 1904 году. Изначально, данная компания поставила перед собой цель производство высококачественных часов по разумной цене. Несмотря на все трудности, которые предстали перед компанией, цель была достигнута. Практически сто лет спустя, наследники этой всемирно известной компании, вновь воссоздали собственный бренд. В 1988 году, на специальной часовой выставке, часами Frederique Constant заинтересовались японцы, которые впоследствии, и стали первыми покупателями. Особенностью этой модели часов являлось прозрачное окно циферблата, сквозь которое можно было увидеть работающие детали механизма. Эта технология стала называться «биение сердца». В 2000 году состоялось «второе рождение» компании. С открытием нового офиса и мастерских рождаются новые дизайнерские решения. На данный момент, владелец часов Frederique Constant считается успешным человеком, который ценит надежность и респектабельность марки.</span></span></p>
 
